import React, {useState, useEffect} from "react";

import useDocumentTitle from "../useDocumentTitle";

import "./pages.css";

function Pages(props) {
  useDocumentTitle(`Farq - ${props.title}`);

  return (
    <div className="container">
      {/* <div className="tracing"></div> */}
      <div className="bg-char">
        <img src={require('../assets/images/Sung.png')}/>
      </div>
      <div className="bg-dot">
        <div className="dot-1">
          <img src={require('../assets/images/Dot.png')}/>
          <img src={require('../assets/images/Dot.png')}/>
          <img src={require('../assets/images/Dot.png')}/>
        </div>
        <div className="dot-2">
          <img src={require('../assets/images/Dot.png')}/>
          <img src={require('../assets/images/Dot.png')}/>
          <img src={require('../assets/images/Dot.png')}/>
          <img src={require('../assets/images/Dot.png')}/>

        </div>
      </div>
      <div className="bottom-1">
        <div className="bottom-black"></div>
        <div className="bottom-purple"></div>
      </div>
      <div className="bottom-2">
        <div className="bottom-black"></div>
        <div className="bottom-purple"></div>
      </div>
    </div>
  );
}

export default Pages;
